-- ----------------------------
-- Procedure structure for openMed
-- ----------------------------
DROP PROCEDURE IF EXISTS `openMed`;
delimiter ;;
CREATE PROCEDURE `openMed`(IN `挂号ID` int,
IN `处方名称` text,
IN `药品列表` text)
BEGIN
	#Routine body goes here...
	DECLARE caseHistoryIDGot INT;
	DECLARE medRecordIDGot INT;
	DECLARE userIDGot INT;
	DECLARE locate1 INT default 0;#用于分割不同种药品
	DECLARE locate2 INT;#用于分割同种药品
	DECLARE tempStr text;
	
	#用于存入处方明细表
	DECLARE medIDGot INT;
	DECLARE medUsageGot text;
	DECLARE medDosageGot text;
	DECLARE medFrequencyGot text;
	DECLARE medAmountGot int;
	
	#处方ID
	DECLARE presIDGot int;
	
	#获得病历号
	SELECT medRecordID INTO medRecordIDGot FROM regist WHERE registID = 挂号ID;
	#获得病历ID
	SELECT caseHistoryID INTO caseHistoryIDGot FROM casehistory WHERE registID = 挂号ID;
	#获得医生ID
	SELECT userID INTO userIDGot FROM regist WHERE registID = 挂号ID;
	#将信息插入处方表
	
	#获得处方号
	SELECT presID INTO presIDGot FROM prescription WHERE registID = 挂号ID;
	
	#拆分字符串
	SET locate1 = LOCATE("/", 药品列表);
	WHILE locate1 > 0
	DO
		#为药品ID赋值
		SET tempStr = LEFT(药品列表, locate1 - 1);
		SET locate2 = LOCATE("*", tempStr);
		SET medIDGot = LEFT(tempStr,locate2 - 1);
		SET tempStr = SUBSTR(tempStr FROM locate2 + 1);
		
		#为药品用法赋值
		SET locate2 = LOCATE("*", tempStr);
		SET medUsageGot = LEFT(tempStr,locate2 - 1);
		SET tempStr = SUBSTR(tempStr FROM locate2 + 1);
		
		#为药品剂量赋值
		SET locate2 = LOCATE("*", tempStr);
		SET medDosageGot = LEFT(tempStr,locate2 - 1);
		SET tempStr = SUBSTR(tempStr FROM locate2 + 1);
		
		#为药品频率赋值
		SET locate2 = LOCATE("*", tempStr);
		SET medFrequencyGot = LEFT(tempStr,locate2 - 1);
		SET tempStr = SUBSTR(tempStr FROM locate2 + 1);
		SELECT medFrequencyGot;
		
		#为药品数目赋值
		SET locate2 = LOCATE("*", tempStr);
		SET tempStr = SUBSTR(tempStr FROM locate2 + 1);
		SELECT tempStr;
		SET medAmountGot = tempStr;
		
		#将信息插入表
		presdetail(presDetailID, presID, medID, medUsage, medDosage, medFrequency, medAmount)
		VALUES 
		(NULL, presIDGot, medIDGot, medUsageGot, medDosageGot, medFrequencyGot, medAmountGot);
		
		#读取下个药品
		SET 药品列表 = SUBSTR(药品列表 FROM locate1 + 1);
		SET locate1 = LOCATE("/", 药品列表);
	
	END WHILE;

END
;;
delimiter ;

