DROP PROCEDURE IF EXISTS `openMedNew`;
delimiter ;;
CREATE PROCEDURE `openMedNew`(in 处方ID int,
in 药品ID int,
in 药品用法 text,
in 药品用量 text,
in 用药频率 text,
in 药品数量 int)
