#将信息插入表
		presdetail(presDetailID, presID, medID, medUsage, medDosage, medFrequency, medAmount)
		VALUES 
		(NULL, 处方ID, 药品ID, 药品用法, 药品用量, 用药频率, 药品数量);
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for pay
-- ----------------------------
DROP PROCEDURE IF EXISTS `pay`;
delimiter ;;
CREATE PROCEDURE `pay`(IN `处方ID` int,IN `操作员ID` int)
leave_name: BEGIN
	#Routine body goes here...
	DECLARE presIDGot INT DEFAULT 0;
	DECLARE billNumberSet INT;
	DECLARE registIDGot INT;
	DECLARE medIDGot INT;
	DECLARE medPriceGot DOUBLE;
	DECLARE medAmountGot INT;
	DECLARE billPriceGot DOUBLE DEFAULT 0;
	DECLARE i INT DEFAULT 0;
	DECLARE medCount INT DEFAULT 0;
	DECLARE A text;
	#从presdetail获取药品ID, 药品价格，药品数量
	DECLARE mc CURSOR FOR SELECT medID, medAmount FROM presdetail WHERE presID = 处方ID;
	
	# 获取挂号ID
	SELECT registID INTO registIDGot FROM prescription WHERE 处方ID = presID;
	
	#判断是否开立，若开立，更新缴费状态
	SELECT presID INTO presIDGot FROM prescription WHERE 处方ID = presID;
	IF presIDGot = 0
	THEN SET A = "还未开立";
	LEAVE leave_name;
	ELSE UPDATE prescription SET paidOrNot = 1 WHERE presID = 处方ID;
	END IF;
	
	#生成病历号
	SET billNumberSet = 800000 + 处方ID*2 + 操作员ID + FLOOR(RAND() * 10000) ;
	
	OPEN mc;
	#通过循环获取结果
	SELECT COUNT(*) INTO medCount FROM presdetail WHERE presID = 处方ID;
	REPEAT
		FETCH mc INTO medIDGot, medAmountGot;
		#获取药品单价
		SELECT medPrice INTO medPriceGot FROM medmenu WHERE medIDGot = medID;
		
		#计算发票价格
		SET billPriceGot = billPriceGot + medPriceGot * medAmountGot;
		
		#插入缴费明细
		
		SET i = i + 1;
	
	UNTIL i >= medCount END REPEAT;
	CLOSE mc;
	
	
	SET A = "成功";

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for regist
-- ----------------------------
DROP PROCEDURE IF EXISTS `regist`;
delimiter ;;
CREATE PROCEDURE `regist`(IN `身份证号` bigint,
IN `姓名` text,
IN `性别` text,
IN `生日` DATE,
IN `年龄` INT,
IN `午别` text,
IN `科室` int,
IN `医师号` int,
IN `是否需要病历本` TEXT)
BEGIN
	#Routine body goes here...
	DECLARE recordID INT DEFAULT 0; 
	
	SELECT medRecordID INTO recordID FROM regist WHERE idNumber = 身份证号;
	
	IF recordID = 0 then set recordID = 年龄*100 + 性别 + 是否需要病历本*2 + 医师号*3 + 科室*10 + 600000;
	END IF;
	
  age, registDate, regisTime, deptID, userID, seenDoctor, idNumber, needNotebook)
	VALUES (NULL, recordID, 姓名, 性别, 生日, 年龄, SYSDATE(), 午别,
	科室, 医师号, 0, 身份证号, 是否需要病历本);

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for treat
-- ----------------------------
DROP PROCEDURE IF EXISTS `treat`;
delimiter ;;
CREATE PROCEDURE `treat`(IN 挂号ID INT,
IN 主诉 text,
IN 现病史 text,
IN 现病治疗情况 text,
IN 既往病史 text,
IN 过敏史 text,
IN 体格检查 text,
IN 建议 text,
IN 注意事项 text,
IN 诊断结果 text)
BEGIN
	DECLARE 病历号 INT;
	#Routine body goes here...
	DECLARE medRecordIDtoGet INT;
	SELECT medRecordID INTO medRecordIDtoGet FROM regist WHERE registID = 挂号ID;
	SET 病历号 = medRecordIDtoGet;
	
	VALUES(null, medRecordIDtoGet, 挂号ID, 主诉, 现病史, 现病治疗情况, 既往病史, 过敏史, 体格检查, 建议, 注意事项, 1, 诊断结果);
    UPDATE regist SET seenDoctor = 1 WHERE registID = 挂号ID;
	
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for unpay
-- ----------------------------
DROP PROCEDURE IF EXISTS `unpay`;
delimiter ;;
CREATE PROCEDURE `unpay`(IN `处方ID` int,IN `发票号` int)
leave_name:BEGIN
	#Routine body goes here...
	DECLARE paidOrNotGot INT;
	DECLARE registIDGot int;
	DECLARE presIDGot INT DEFAULT 0;
	DECLARE medCount INT;
	DECLARE pricePerProjectGot DOUBLE;
	DECLARE newPricePerProject DOUBLE;
	DECLARE projectAmountGot INT;
	DECLARE billPriceGot DOUBLE;
	DECLARE newBillPrice DOUBLE;
	DECLARE i int DEFAULT 0;
	DECLARE A text;
	
	#游标
	DECLARE mc CURSOR FOR SELECT registID, pricePerProject, projectAmount 
	FROM costdetail 
	WHERE 发票号 = billNumber;
	
	#获取挂号ID
	SELECT registID INTO registIDGot FROM prescription WHERE 处方ID = presID;
	
	#判断是否开立，若开立，更新缴费状态
	SELECT presID INTO presIDGot FROM prescription WHERE 处方ID = presID;
	IF presIDGot = 0
	THEN SET A = "处方不存在";
	LEAVE leave_name;
	END IF;
	
	#更新缴费状态
	UPDATE prescription SET paidOrNot = 2 WHERE 处方ID = presID;
	
	#将明细添加进入缴费明细中......
	OPEN mc;
	
	SELECT count(*) INTO medCount FROM costdetail WHERE billNumber = 发票号;
	
	REPEAT
		FETCH mc INTO registIDGot, pricePerProjectGot, projectAmountGot;
		
		SET newPricePerProject = pricePerProjectGot * -1;
		
		
		SET i = i + 1;
		
	UNTIL i >= medCount END REPEAT;
	CLOSE mc;
	
	SELECT billPrice INTO billPriceGot FROM bill WHERE billNumber = 发票号;
	SET newBillPrice = billPriceGot * -1;
	
	
	SET A = "成功";
	

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for unregist
-- ----------------------------
DROP PROCEDURE IF EXISTS `unregist`;
delimiter ;;
CREATE PROCEDURE `unregist`(IN 病历号 INT)
BEGIN
	#Routine body goes here...
	DECLARE regState int;
	
	SELECT seenDoctor INTO regState FROM regist WHERE 病历号 = medRecordID;
	
	IF regState = 0
	THEN UPDATE regist SET seenDoctor = 3 WHERE 病历号 = medRecordID;
	END IF;

END
;;
delimiter ;

